import bottomRightImage from "./images/rd.png";
import bottomLeftImage from "./images/sd.png";
import topLeftImage from "./images/se.png";
import backgroundImage from "./images/Rectangle.png";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  const backgroundStyle = {
    backgroundImage: `url(${backgroundImage})`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    width: "100vw",
    height: "100vh",
  };

  return (
    <Router>
      <div style={backgroundStyle}>
        <img className="fixed-top-left" src={topLeftImage} alt="Top Left" />
        <img
          className="fixed-bottom-left"
          src={bottomLeftImage}
          alt="Bottom Left"
        />
        <img
          className="fixed-bottom-right"
          src={bottomRightImage}
          alt="Bottom Right"
        />
        <Switch>
          <Route path="/about">
            <div>about</div>
          </Route>
          <Route path="/users">
            <div>users</div>
          </Route>
          <Route path="/">
            <div>home</div>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
